// import logo from './logo.svg';
import './App.css';
import Movie from './Movie';
import { render } from '@testing-library/react';

export default function App() {
      return (
        <div className="App">
          <Movie></Movie>
        </div>
      );
}
ReactDOM.render(<App/>, document.getElementsByClassName('App'))
